#include "ui/msdf_font.h"
#include "foundation/io.h"

#include <stb_ds.h>
#include <GLES3/gl3.h>

msdf_font* msdf_alloc() {
    msdf_font* font = (msdf_font*)malloc(sizeof(msdf_font));
    hmdefault(font->char_map, (msdf_glyph){0});
    hmdefault(font->kerning_map, 0);
    return font;
}

msdf_font* msdf_font_load(ustring json_path, ustring image_path)
{
    msdf_font* font = msdf_alloc();

    return font;
}

float2 msdf_font_compute_size_and_offset(msdf_font *font, ustring text, f32* offsets) {
    float2 size = (float2){.x = 0.f, .y = (f32)font->line_height};
    int prev_id = -1;
    for (int i = 0; i < text.length - 1; ++i) {
        int char_code = (int)text.data[i];
        msdf_glyph g = msdf_font_get_glyph(font, char_code);
        if (g.id == 0) continue;
        size.x += (f32)g.xadvance + (f32)msdf_font_computer_kerning(font, (kerning_key){.first = prev_id, .second = g.id});
        prev_id = g.id;
        if (offsets != NULL) offsets[i] = size.x;
    }
    return size;
}

msdf_glyph msdf_font_get_glyph(msdf_font *font, int index) {
    return hmget(font->char_map, index);
}

int msdf_font_computer_kerning(msdf_font *font, kerning_key key) {
    return hmget(font->kerning_map, key);
}

